import {Navigate} from "react-router-dom";
import DashboardEditions__chief from "./chief/DashboardEditions__chief";
import {getUserData, validUser} from "../api/handleLogin";
import React, {useEffect, useState} from "react";
import Login from "./Login";
import {getRedirectStatus, getRank} from "../helpers/redirection";

export function Dashboard() {

    const [rank, setRank] = useState("");
    useEffect(() => {
        getRank()
            .then(resp => {
                setRank(resp)
            }, [])
    });

    return(
        <>
            {rank == "arriviste" && <Navigate to={"/"}/>}
            {rank == "admin" && <DashboardEditions__chief/>}
            {rank == "redactor" && <h1>Not Admin</h1>}
        </>
    )

}
